			var city1 = city.simulation;
			var _g = [];
			var _g1 = 0;
			var _g2 = city.worlds;
			while(_g1 < _g2.length) {
				var v = _g2[_g1];
				++_g1;
				if(common_ArrayExtensions.any(city.simulation.citizens,(function(w) {
					return function(ct) {
						return ct.onWorld == w[0];
					};
				})([v]))) {
					_g.push(v);
				}
			}
			city1.createCitizen(_g[0],random_Random.getFloat(18,40));
